import React from 'react';
// import sections
import Inputframe from '../components/login/sections/logininput';
import Loginheader from '../components/login/sections/loginheader';


const sectionHeader = {
  title: 'Follow the work',
  paragraph: 'Support the movement.'
};


const Login = () => {

  return (
    <>
      <Loginheader navPosition="right" className="reveal-from-bottom" />
      <Inputframe className="illustration-section-01" />
    </>
  );
}

export default Login;
